  category: string;
  description: string;
  types: Personality[];
  onClose: VoidFunction;
}
export const MenuItem = ({
  types,
  category,
  description,
  onClose
}: MenuItemProps) => <Menu.Item className={s.item} component='div'>
        <Title mb='xxs' fz={20} order={3}>
            {category}
        </Title>
        <Text mb='xs' fz={18} lh='21px'>
            {description}
        </Text>
        <Flex className={s.items} gap='md'>
            {types.map(type => <Paper py='sm' px={32} radius='md' component='a' key={type.code} onClick={onClose} className={s.paper} href={`${ROUTES.TYPES}/${type.code}`} data-color={`${titleColorMap[category]}`}>
                    <Stack gap={6} align='center'>
